import { useContext } from "react";
import { DataContext } from "../../Context/Dataprovider";

// component
import Banner from "../Banner/banner";

const Home = () =>
{
    const { Display_User_Name } = useContext(DataContext);

    return (
      <div>
        <h1>Welcome to home page {Display_User_Name}</h1>
        <Banner />
      </div>
    );
}

export default Home;
